import React from "react";
import { Image } from "./image"; // Assuming Image component is defined elsewhere

export const Gallery = (props) => {
  return (
    <div id="portfolio" className="text-center">
      <div className="container">
        <div className="section-title">
          <h2>Me De Gallery</h2>
          <p>Some of my favourites</p>
        </div>
        <div className="row">
          <div className="portfolio-items">
            {props.data
              ? props.data.map((d, i) => (
                  <div key={`${d.title}-${i}`} className="col-sm-6 col-md-4 col-lg-4 portfolio-item">
                    <div className="gallery-image">
                      <img src={d.smallImage} alt={d.title} />
                    </div>
                  </div>
                ))
              : "Loading..."}
          </div>
        </div>
      </div>
    </div>
  );
};
